INSERT INTO `jobs` (`id`, `content`) VALUES
(1, '<p></p><p></p><p></p><p></p><p></p><p></p><h1><font color=\"#c24f4a\"><b>长艺招募精英，广纳贤才：&nbsp;</b>&nbsp;</font></h1><div><font color=\"#c24f4a\"><br></font></div><h2><font color=\"#000000\"><strong>1、平面设计2人。高中以上学历</strong><strong>（28岁以下，充满激情，独具创意，身心健康。</strong></font></h2><h2><strong><font color=\"#000000\">2、雕刻操作1人。高中以上学历（28岁以下，细致入微，善于变通，身心健康。）</font></strong></h2><h2><font color=\"#000000\"><strong>3、吸塑操作</strong><strong>熟手</strong><strong>人1人。高中以上学历（35岁以下，吃苦耐劳，责任心强，身心健康）</strong></font></h2><h2><strong><font color=\"#000000\">4、广告制作安装熟手2人。（限男生、35岁以下，身心健康，吃苦耐劳。）</font></strong></h2><h2><strong><font color=\"#000000\">5、广告制作安装学徒1人。（24岁以下，心灵手巧，身心健康，学习上进心强，有无经验均可。)</font></strong></h2><p><strong><br></strong></p><h1><font color=\"#c24f4a\"><b>薪酬丰厚，机遇无限：&nbsp;&nbsp;</b></font></h1><div><font color=\"#c24f4a\"><b><br></b></font></div><h2><b>1、享受统一食宿。&nbsp;</b></h2><h2><b>2、每月两天休息保障，每天8小时工作制，超出算加班。</b></h2><h2><b style=\"color: inherit;\">3、基本工资+加班补贴+特殊贡献=每月薪酬。</b></h2><h2><b>4、外出交通凭票报销+外出餐饮凭票报销=外出无忧。</b></h2><p><br></p><p><b>有意</b>者请将最您近生活照及个人真实简历投至这个邮箱：XXX，收到简历后我们将及时通知您，并安排时间面试。期待您的早日加入！</p><p><br></p>');
