INSERT INTO `news` (`id`, `title`, `img`, `content`, `des`, `created_at`, `updated_at`) VALUES
(2, '测试新闻', NULL, '<p></p><p></p><p>测试新闻内容</p><p><br></p>', 'ewrewreweew测试描述', '2018-09-24 11:19:24', '2018-10-28 06:42:53'),
(3, '车身广告制作流程方法', NULL, '<p></p><p>车身广告能够在户外移动的展示广告信息，还能够给户外的环境添加一些惬意，让人不仅能看到车水马龙的交通，也能够欣赏到移动的广告画面。下面是对车身广告制作方法的详细介绍：<br>1、整车油漆喷涂车身广告制作<br>最早，最原始的就是烤漆(1K、2K)、调和漆(骆驼牌、三峡等)这2种漆又分进口和国产制作流程比较复杂：清理车身清洁、补膏灰、打磨、喷底漆(细致点的话再补沙眼、打磨、补底漆)、喷面漆及制作设计画面。这种制作目前很少采用，效率较低。油漆制作，油漆制作首先是要损坏原车漆，无法复原。优点喷涂像素高。<br>2、现在最常用的车身广告制作<br>整车全贴喷绘背胶画面即车贴制作工艺。简单实用即把设计好的画面按具体车身尺寸电脑喷绘出来再粘贴上去就可以了　。当然粘贴也有一定技术含量，粘贴不好容易气泡。影响外观，再一个车贴有一个劣势就是容易伤车漆，毕竟胶体也是化学制剂，对车漆有腐蚀作用。去除车贴的时候也会粘带车漆下来，车贴耐侯性较差。车体价格较低，每平米几十元即可。<br>3、局部电脑车贴喷绘与油漆相结合的车身广告制作<br>制作流程跟上一种情况基本一样，深圳公交车身广告采用局部电脑喷绘主要用于复杂画面粘贴(比如包装盒、品牌代言人等)。 公交车车身广告一般采用这种方式。越来越多的车身广告也是采用这种方法；优点只用做局部更改，节约成本，而广告效果有所提高。<br>4、使用丝网印刷<br>根据丝印原理,把油墨印刷到平板玻璃的表面,而后采用油墨的固化措施,使得图案牢固经久耐用。其工艺过程　　绷网，上浆，干燥，晒版，显影，干燥 平板玻璃切裁，磨边，清洗干燥，印刷，烧结。　工序较多，且成本高 并不适合用于车身的制作。<br>5、汽车彩绘机用于车身广告制作<br>世界最先进制作工艺 将取代传统车身制作工艺。目前国际上最新的车体广告制作方式，汽车彩绘机，直接车体打印。与传统的制作方式相比有以下的优点：不伤原车漆;随时可以更换图案，曲面跟踪喷绘增加图案的真实感;可以从电脑直接打印可选图案资源丰富;彩绘机采用进口喷墨喷绘，无味且环保，去除方便，节约成本并且可以保持2-3年不变色。<br>我们温馨提示您：车体广告制作简单步骤，首先设计定稿，再次打印样要进行干燥处理，干燥可采用自然干燥和红外线干燥两种方法,干燥后根据图文形状进行裁剪。由于车体广告尺寸较大，为避免向车身转移时，图文不平整，在裁剪后要用转移膜平覆于印刷品表面，这样就方便完成车体广告制作，下一步就是把图文转移到车体上。必须要专业车体广告公司技师来安装，确保广告质量万无一失。<br></p>', '车体广告制作简单步骤，首先设计定稿，再次打印样要进行干燥处理，干燥可采用自然干燥和红外线干燥两种方法,干燥后根据图文形状进行裁剪。由于车体广告尺寸较大，为避免向车身转移时，图文不平整，在裁剪后要用转移膜平覆于印刷品表面，这样就方便完成车体广告制作，下一步就是把图文转移到车体上。', '2018-11-07 08:23:23', '2018-11-07 08:23:23'),
(4, '高速公路广告牌制作规定与流程', NULL, '<p></p><p>按照国家相关公路法规，收费公路的广告经营权应该属于具有路产权的单位.<br>高速公路上立广告牌，需要经过高速公路公司同意，按照国家法规，高速公路沿路边向外30米为路产保护范围，但实际中，各个省份的道路交通法规一般对此距离另有规定，比如有的省份规定国家级干道距离是50米，一般高速30米。高速公路的广告牌我们通常称为单立柱，版面规格一般是18米*6米，建造费用，以总高度21米为例，建造一座单立柱的费用是10万-12万之间，这个价格间隔波动主要取决你材料的使用。<br>另外在很多高速公路出现了30米以外的广告牌，这个在各个省份的具体情况都不一样，从法规上来说，这些广告牌属于违章广告，但根据国家公路法规，又不在高速公路路产范围内，因此争议很多，这类广告位不用到高速公路审批，因为占用的是农民的土地，因此只需要跟农民谈好就可以了。<br>全流程如下：<br>1、与广告牌归属地签署土地使用合同<br>2、广告位向工商部门报批许可证<br>3、基础开挖<br>4、浇筑混凝土基础<br>5、树立钢管<br>6、铺设电缆<br>7、上钢架<br>8、批铁皮<br>9、安装照明灯<br>10、安装喷绘画面<br></p>', '高速公路上立广告牌，需要经过高速公路公司同意，按照国家法规，高速公路沿路边向外30米为路产保护范围，但实际中，各个省份的道路交通法规一般对此距离另有规定，比如有的省份规定国家级干道距离是50米，一般高速30米。', '2018-11-07 08:47:20', '2018-11-07 08:47:20'),
(5, '喷绘写真设计注意哪些事项？', NULL, '<p></p><p>喷绘指户外广告画面输出，它的输出画面很大，一般户外喷绘的最大幅宽为3.2米、5米。喷绘机一般使用油墨较多，所以喷出的画面比电脑上所看到的要略深一些。<br>写真分为户外写真和户内写真两种，户内写真只能在户内使用表面可过光腹和亚腹两种常用腹。户外写真可以户外长时间使用，不用过腹也可以。一般幅宽为1.5米。写真机一般使用的材料为海报PP纸、背胶PP纸、灯片、相片纸、艺术布等。输出分辨率可达到300~1200DPI，色彩较饱和，清晰。<br>喷绘写真设计注意哪些事项？<br>一、尺寸大小<br>喷绘图像尺寸大小和实际画面要求是一样的，它和印刷不同，不需要留“出血”。喷绘公司一般会在输出画面时留“白边”（一般为10CM），也可要求其单位留多少厘米“扣眼”）写真图像不需留“出血”，也按照其实际尺寸设置即可。<br>二、图像分辨率要求<br>喷绘图像往往很大，如果如此大的分辨率还要用印刷分辨率进行制图，那电脑铁定累死。实际上喷绘分辨率没有特别死的标准，以下根据制图大小做一个简单介绍，仅供参考：180平方米以上（DPI：11.25）、30~180平方米（DIP：22.5）、1~30平方米（DPI：45）。<br>三、图像模式要求<br>喷绘和写真统一使用CMYK图像模式，禁止使用RGB模式。现在的喷绘机都是四色喷绘，在做图里按照印刷标准走，喷绘公司会调整画面颜色和小样接近的。<br>四、图像黑色部分要求<br>喷绘与写真制图时都严禁使用单黑，必须添加C、M、Y色，组成混合黑。假如是大黑，可以做成：C=50，M=50，Y=50，K=100。特别是在PS里面用它带的效果时，注意把颜色改为四色黑，否则喷图会出现横道，甚至喷不出来，影响整体效果。<br>五、图像存储要求<br>图像一般存储为TIF格式。<br></p>', '喷绘指户外广告画面输出，它的输出画面很大，一般户外喷绘的最大幅宽为3.2米、5米。喷绘机一般使用油墨较多，所以喷出的画面比电脑上所看到的要略深一些。', '2018-11-15 09:29:26', '2018-11-15 09:29:26'),
(6, '广告设计思维与广告设计方法', NULL, '<p></p><p>广告设计思维与广告设计方法是相辅相成的，广告创造性思维是一种摆脱了习惯定式解决问题的思维方式，它需要鼓励在发散性思维的基础上进行聚合思维，创造性地解决问题，吸引观看者的眼球和意识。 <br>横向思维 <br>横向思维能使我们摆脱旧有的思维模式和思维习惯，有助于我们寻找尽可能多的不同的解题途径和思路。它可作为纵向思维的对立方式。纵向思维是要把同一口井继续挖深，横向思维则是要试试其它位置。从美术创作的角度看，如不同工具材料的运用，不同构图方法的表现，不同题材、内容的选择等形式都是要运用横向思维来创作。 <br>求异思维 <br>求异思维也是相对于常规思维来说的，其思维活动的要诀在于不受任何框架、模式的约束，从而突破传统观念和习惯势力的禁锢，从新的角度认识问题，以新的思路、新的方法解决现实难题或创造更好、更美的东西。逆向思维是求异思维的一种重要形式，也是众多创造性思维成果诞生的重要运思策略。我们从美术创作的角度看，如可以画花的生长或凋谢过程，可以把正视、俯视、仰视等结合起来在同一作品中，可以把一幅作品剪贴、随意粘贴、想象成另外的作品等形式都是要运用求异思维来创作。<br>想象思维 <br>想象思维也是创造性思维的主要表现形式之一。想象思维是人体大脑通过形象化的概括作用，对脑内已有的记忆表象进行加工、改造或重组的思维活动。想象思维可以说是形象思维的具体化，是人脑借助表象进行加工操作的最主要形式，是人类进行创新及其活动的重要的思维形式。 <br>想象思维有再造想象思维和创造想象思维之分。再造想象思维是指主体在经验记忆的基础上，在头脑中再现客观事物的表象；创造想象思维则不仅再现现成事物，而且创造出全新的形象。我们从美术创作的角度看，如可以创作飞翔的人，可以创作把地球放在手上，也可以创作动植物组合成新的生物等形式都是要运用想象思维来创作。 <br>发散思维 <br>突破常规是创造型思维的本质所在，这一点在发散思维中表现得十分明显。 “正是在发散思维中，我们看到了创造性思维最明显的标志。”发散思维是指从一个目标出发，沿着各种不同的途径去思考，探求多种答案的思维，与聚合思维相对。<br>直觉思维 <br>直觉思维是相对于逻辑思维来说的，它是指人们不经过逐步分析而迅速对问题的答案做出合理猜测或突然顿悟的思维形式。直觉思维着眼于对研究对象的整体性把握，它与逻辑思维强调对研究对象的局部性分析是很不同的。直觉思维能力强的人常常会从一些偶然事件中突然领悟问题的实质。 以下广告设计创新方法！&nbsp; <br>现实<br>消费者不是一个可以任意施加影响的消极主体，而是一个具有一定的要求、信念、定势和意向，有着判断是非标准的积极客体，他们对广告的内容完全是根据自己要求的价值标准加以摄取或排斥的。所以，说实话、抒真情是广告的生命，是赢得受众的本质力量，也是对社会负责，对消费者负责的表现。、<br>艺术表现<br>感性诉求广告的目标受众是消费者，在人们的社会心理和市场竞争日新月异的今天，它的表现形式更应该向艺术化的方向发展。今日的消费者不再是纯粹的追求物质满足，他们不仅要求广告能告之他们信息，而且要求有艺术性和娱乐性，满足其心理上的审美需要，所以，没有强撼的艺术感染力的广告是很难与消费者产生情感共鸣的。 <br>在感性诉求广告中可运用的艺术表现手法很多，除了我们前面所提到的谐趣幽默外，还有对比、抒情、夸张、比喻和联想等，应在不同的场合下运用不同的创意以期达到预期的目的。&nbsp; <br></p>', '广告设计思维与广告设计方法是相辅相成的，广告创造性思维是一种摆脱了习惯定式解决问题的思维方式，它需要鼓励在发散性思维的基础上进行聚合思维，创造性地解决问题，吸引观看者的眼球和意识。', '2018-11-16 07:44:24', '2018-11-16 07:44:24'),
(7, '户外广告如何选择喷绘材料', NULL, '<p></p><p>目前我国的户外喷绘广告发展越来越迅速，一些企业为了宣传自己品牌都会选择制作户外喷绘广告，让后把他们安装，或者是摆放在城市中人流量大的繁华位置。想要制作一款质量好的户外喷绘广告不仅需要画面设计具有非常好的创意，而且还要高质量的户外喷绘材料，那么户外喷绘广告制作时应该如何选择喷绘布呢？接下来就随小编一起看看。<br>们都知道户外喷绘广告是在户外使用的，所以它要长期的暴露在户外恶劣的环境下，要接收风吹、日晒、雨淋，或者是遭受细菌等等的污染。这些都会对户外喷绘广告的质量产生严重的影响，甚至会影响户外喷绘广告的使用寿命。小编认为想要户外喷绘广告制作画面耐用，那么就需要注意一下几点：<br>（1）选择性能稳定的喷绘墨水<br>（2）广告布料要有非常好的吸墨性<br>（3）喷绘布的丝与编制结构要非常好<br>（4）选择售后服务齐全的喷绘公司<br></p>', '目前我国的户外喷绘广告发展越来越迅速，一些企业为了宣传自己品牌都会选择制作户外喷绘广告，让后把他们安装，或者是摆放在城市中人流量大的繁华位置。', '2018-11-22 07:49:31', '2018-11-22 07:49:31'),
(8, '广告牌制作有哪些类型', NULL, '<p></p><p>放眼望去，目前市场上的广告类型多又多。就拿户外广告来说，同一个地区的广告说不定都有很多类型。那么广告主如何才能选择适合自己的广告资源呢？这里了解广告牌制作类型是非常有必要的。因为广告牌制作直接决定了其存在的特色以及优势。<br>那么广告牌制作有哪些类型呢？<br>下面小编就以成都为例全面说明目前市面上存在的广告牌制作类型<br>一、地铁广告<br>在地铁范围内设置的各种广告统称地铁广告。其形式有十二封灯箱、四封通道海报、特殊位灯箱、扶梯、车厢内海报等。其特点是人流集中、受注目程度高，能够增加产品的认知度。可以单独或网络式购买。<br>二、机场广告<br>设置在机场周围和机场内部的广告牌。一般针对层次及收入较高的受众，如公干及出外旅游人士。<br>三、射灯广告牌<br>在广告牌四周装有射灯或其他照明装备的广告牌，称为射灯广告牌。其特点是美观，晚上照明效果极佳，并能清晰看到广告信息。<br>四、商场指示广告牌<br>设置在商场范围内的广告形式，以来商场购物客流为主要目标对象，特点是人流量高及可覆盖邻近区域。<br>五、单立柱广告牌<br>广告牌置于特设的支撑柱上，以立柱式T型或P型为多，广告装置设立于高速公路、主要交通干道等地方，面向密集的车流和人流。普通使用的尺寸为6米高X 18米阔，主要以射灯作照明装备。<br>六、大型灯箱<br>置于建筑物外墙、楼顶或裙楼等广告位置，白天是彩色广告牌，晚上亮灯则成为“内打灯”的灯箱广告。灯箱广告照明效果较佳，但维修却比射灯广告牌困难，且所用灯管较易耗损。<br>七、侯车亭广告牌<br>高速广告设置于公共汽车候车亭的户外媒体。以灯箱为主要表现形式。在这类媒体上安排的广告以大众消费品为主。可以单独或网络式购买多个站亭广告位以达到较宽覆盖率甚至覆盖多个城市。<br>就目前来看，广告牌制作类型基本上就是以上七种，在全面了解这些广告牌制作的背后后你是否清楚自己需要投放哪种广告资源呢？<br></p>', '放眼望去，目前市场上的广告类型多又多。就拿户外广告来说，同一个地区的广告说不定都有很多类型。那么广告主如何才能选择适合自己的广告资源呢？这里了解广告牌制作类型是非常有必要的。因为广告牌制作直接决定了其存在的特色以及优势。', '2018-11-22 08:02:24', '2018-11-22 08:02:24');
