INSERT INTO `web_set` (`id`, `contacter`, `phone`, `address`, `tel`, `email`, `intro`) VALUES
(1, '马先生', '13136011345', '海南省海口市龙华区海垦路6号冶矿联大厦5楼', '0898-66566954', NULL, '<p></p><p>海口长艺广告有限公司专业从事大中型户外广告制作、亮化工程、庆典活动及印刷制品等。公司一直本着\"求真务实\"的公司文化，立足客户市场，致力于成为国际旅游岛最具活力、成长性的广告制作及传媒的后起之秀。</p><p>Haikou Changyi Advertising Co., Ltd. specializes in large and medium-sized outdoor advertising production, lighting engineering, celebration activities and printing products. The company has been committed to becoming the most dynamic and growing advertising producer and media star of the international tourism island based on the company culture of \"seeking truth and pragmatism\" and based on the customer market.</p>');
